<!DOCTYPE HTML>
<html>
	<head>
		<title>QUnit Page for sap.ui.base.ManagedObjectMetadata</title>
		<script src="../shared-config.js"></script>

		</script>
		<script>
			jQuery.sap.require("sap.ui.qunit.qunit-2-css");
			jQuery.sap.require('sap.ui.thirdparty.qunit-2');
			jQuery.sap.require('sap.ui.qunit.qunit-junit');
			jQuery.sap.require('sap.ui.qunit.qunit-coverage');

			window.blanket && window.blanket.options('sap-ui-cover-only', '[sap/ui/base/ManagedObjectMetadata.js]');

			jQuery.sap.includeScript('./ManagedObjectMetadata.qunit.js');
		</script>
	</head>
	<body>
		<div id="qunit"></div>
	</body>
</html>
